class Solution {
public:
    int maxJump(vector<int>& stones) {
        int n = stones.size();
        int l = 1, h = stones.back() - stones.front();
        // auto check0 = [&](set<int>& st, int m) {
        //     int x = stones.front(), e = stones.back();
        //     while (!st.empty() && e - x > m) {
        //         auto p = st.upper_bound(x + m);
        //         if (p == st.begin()) {
        //             return false;
        //         }
        //         p = prev(p);
        //         x = *p;
        //         st.erase(p);
        //     }
        //     return e - x <= m;
        // };
        auto check0 = [&](vector<bool>& vst, int m) {
            int i = 0, j = 1;
            vst[n - 1] = false;
            while (i < n - 1) {
                int k = i;
                while (j < n && stones[j] - stones[i] <= m) {
                    if (!vst[j]) {
                        k = j;
                        
                    }
                    ++j;
                }
                if (k == i) {
                    return false;
                }
                i = k;
                vst[i] = true;
            }
            return true;
        };
        auto check = [&](int m) {
            // set<int> st(stones.begin() + 1, stones.end() - 1);
            vector<bool> vst(n, false);
            return check0(vst, m) && check0(vst, m);
        };
        int ans = 1;
        while (l <= h) {
            int m = (l + h) / 2;
            if (check(m)) {
                ans = m;
                h = m - 1;
            } else {
                l = m + 1;
            }
        }
        return ans;
    }
};

